/*!40014 SET @OLD_FOREIGN_KEY_CHECKS=@@FOREIGN_KEY_CHECKS, FOREIGN_KEY_CHECKS=0 */;

SET NAMES 'utf8';

USE mnemoshema;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'config_url', 'http://127.0.0.1:9797', 'Web адрес сервера конфигурации для подключения и настройки точек сбора данных, датчиков и устройств. Пример http://127.0.0.1:9797') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'config_url') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'current_log_level', '3', 'Уровень логирования: 0 - отслеживание, 1 - отладка, 2 - предупреждение, 3 - ошибка, 4 - логирование отключено') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'current_log_level') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'mnemoshma_update_data_manager_protocol', '2', 'Протокол получения данных на мнемосхеме: 1 - SMB (расшаренные файлы), 2 - http') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'mnemoshma_update_data_manager_protocol') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'mnemoshma_update_alarm_data_manager_protocol', '1', 'Протокол получения событий на мнемосхеме: 1 - SMB (расшаренные файлы), 2 - http') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'mnemoshma_update_alarm_data_manager_protocol') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'TimerUpdateActiveAlarmsInterval', '1000', 'Частота запроса активных событий, мс. По умолчанию 1000 мс.') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'TimerUpdateActiveAlarmsInterval') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'TimerUpdateDataInterval', '1000', 'Частота запроса данных, мс. По умолчанию 1000 мс.') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'TimerUpdateDataInterval') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'TimerUpdateUIInterval', '100', 'Частота обновления пользовательского интерфейса, мс. По умолчанию 100 мс.') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'TimerUpdateUIInterval') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'TimerRealTimeUpdateInterval', '1000', 'Частота запроса данных на форме графиков, мс. По умолчанию 1000 мс.') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'TimerRealTimeUpdateInterval') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'use_multithreading_data_update', '0', 'Запрос на получения данных для каждого датчика запускается в отдельном потоке. 0 - отключить многопоточность, 1 - включить многопоточность') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'use_multithreading_data_update') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'enable_auto_update', '1', 'Включить/Выключить автообновление ПО. 1 - Включить, 0 - выключить.') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'enable_auto_update') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'count_of_period_before_brake', '10', 'Количество периодов до обрыва отображаемых данных') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'count_of_period_before_brake') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'http_device_updater', '1', 'Один http запрос для устройства') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'http_device_updater') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'default_precision', '4', 'Точность представления данных по умолчанию') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'default_precision') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'update_sensor_description_after_import_device_setting', '1', 'Обновление описания устройств') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'update_sensor_description_after_import_device_setting') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'disconnect_after_http_get', '1', 'Разорвать соединение после ответа') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'disconnect_after_http_get') LIMIT 1;

INSERT INTO settings (`name`, `value`, `description`) 
SELECT * FROM (SELECT 'max_global_event_to_processing', '1000', 'Максимальное количество обрабатываемых пользовательских событий') AS tmp
WHERE NOT EXISTS (SELECT `name` from settings WHERE name = 'max_global_event_to_processing') LIMIT 1;

INSERT INTO `user` (login, password,  description, settings) 
SELECT * FROM (SELECT 'Администратор', '1', 'Администратор: создан автоматически', '{"sensor_group":[],"settings":{},"sensors":{},"filters":{}}') AS tmp
WHERE NOT EXISTS (SELECT login from `user` WHERE login = 'Администратор') LIMIT 1;

UPDATE `user` set is_admin = 1 WHERE login = 'Администратор';

INSERT INTO `reports` (name, template, title, description) 
SELECT * FROM (SELECT 'TemplateDeviceEvents', x'', 'eventTemplateDevice.odt', 'Базовый шаблон для отчета событий по устройству') AS tmp
WHERE NOT EXISTS (SELECT name from `reports` WHERE name = 'TemplateDeviceEvents') LIMIT 1;

INSERT INTO img (uuid, height, width, `size`, name, img)
SELECT * FROM (SELECT 'CraneCarriage1', 103, 63, 19830, 'CraneCarriage1.bmp', x'') as tmp
